import { Box, Image } from 'native-base';

export const EmployeeCard = () => (
  <Box p="2" w="100%">
    <Image
      source={{
        uri: 'https://i.pravatar.cc/300',
      }}
      alt="Person"
      size="md"
      resizeMode={'contain'}
      borderRadius={100}
    />
  </Box>
);

export default EmployeeCard;
